WOMT_aTexte['0_ms_intro_text']=new Array();
WOMT_aTexte['0_ms_intro_text'][0]='[PARTEIENANZAHL] Parteien haben die Wahl-O-Mat-Thesen beantwortet. Jetzt sind Sie an der Reihe: Vergleichen Sie Ihre Standpunkte mit den Antworten der Parteien.<br/><br/>Der Wahl-O-Mat ist keine Wahlempfehlung, sondern ein Informationsangebot über Wahlen und Politik.';
WOMT_aTexte['0_ms_intro_text'][1]='[PARTEIENANZAHL] parties have answered these Wahl-O-Mat questions. Now it#s your turn: compare your stance on the issues with the positions of the parties.<br/>The Wahl-O-Mat does not provide a recommendation whom to vote for, rather information about the German election and politics.';
