WOMT_aTexte['4_erg_text_3']=new Array();
WOMT_aTexte['4_erg_text_3'][0]='Um zu sehen, wie Ihr Wahl-O-Mat-Ergebnis zustande kam, vergleichen Sie einfach Ihre Position zu jeder These mit den Antworten der Parteien. Viele Parteien haben ihre Antworten zu den Thesen begründet. Um diese zu sehen, klicken Sie einfach auf das entsprechende Antwort-Symbol der Partei zur jeweiligen These.';
WOMT_aTexte['4_erg_text_3'][1]='To see how your Wahl-O-Mat results were calculated, simply compare your answer to the party responses. Many parties have explained their policy stances. In order to see their position on the issues, simply click on the respective party symbol on each question.';
