WOMT_aTexte['popup_faq_9_text']=new Array();
WOMT_aTexte['popup_faq_9_text'][0]='Die Beschränkung auf acht Parteien dient vor allem der Übersicht und Vergleichbarkeit. Eine Auswertung von mehr als acht Parteien gleichzeitig kann im Wahl-O-Mat nicht mehr sinnvoll und für den Nutzer nachvollziehbar dargestellt werden. Allerdings kann man nach der ersten Auswertung auf "zurück zur Parteienauswahl" klicken. Jetzt kann man sich für eine andere Auswahl von maximal acht Parteien entscheiden und sich ein neues Ergebnis errechnen lassen. Dafür müssen nicht alle Thesen neu beantwortet werden. <br/>Zudem bieten wir Ihnen auf der Ergebnisseite des Wahl-O-Mat ein PDF zum Download an, in dem alle Antworten der Parteien und sonstigen politischen Vereinigungen auf die Wahl-O-Mat-Thesen zusammengefasst sind.';
WOMT_aTexte['popup_faq_9_text'][1]=' ';
WOMT_aTexte['popup_faq_2_frage']=new Array();
WOMT_aTexte['popup_faq_2_frage'][0]='Wie ist der Wahl-O-Mat entwickelt worden? Sind die Parteien und Wählervereinigungen daran beteiligt gewesen?';
WOMT_aTexte['popup_faq_2_frage'][1]='&nbsp;';
WOMT_aTexte['popup_faq_2_text']=new Array();
WOMT_aTexte['popup_faq_2_text'][0]='Der Wahl-O-Mat ist für die Bundesrepublik Deutschland erstmals zur Bundestagswahl 2002 eingesetzt worden. Er wurde von einer unabhängigen Redaktion, die aus jungen Erwachsenen besteht, in Kooperation mit der Bundeszentrale für politische Bildung/bpb und mit Unterstützung ihrer Partner und des niederländischen Instituut voor Publiek en Politiek (Institut für Öffentlichkeit und Politik - IPP) entwickelt. Dabei ging der Wahl-O-Mat aus dem StemWijzer hervor. Das ist ein vom IPP entwickelter Test, mit dem Sie feststellen können, wie Sie persönlich zu den Zielen und Positionen von Parteien stehen. Dieser Test gehört in den Niederlanden seit langem fest zum Vorwahlgeschehen. Bei der Bundestagswahl 2002 wurde der Wahl-O-Mat über 3,6 Millionen mal gespielt. Seitdem wurde er von der bpb bei über zehn Landtagswahlen, sowie den Europawahlen 2004 und 2009 eingesetzt. Zur Bundestagswahl 2005 wurde der Wahl-O-Mat über 5,1 Millionen und zur Europawahl 2009 mehr als 1,5 Millionen mal gespielt. <br/><br/>Die Redaktion des Wahl-O-Mat für die Bundestagswahl 2009 bestand aus insgesamt 21 jungen Menschen aus ganz Deutschland, unterstützt von Wissenschaftlern und Experten sowie der bpb. In zwei Workshops hat die Redaktion die Thesen des Wahl-O-Mat entwickelt und formuliert. Den Parteien und sonstigen politischen Vereinigungen wurde eine Liste mit insgesamt 87 Thesen zugeschickt. Sie wurden gebeten, die Thesen entsprechend der Parteihaltung mit "stimme zu", "stimme nicht zu" oder "neutral" zu beantworten. Aus den ausgefüllten Listen wurden diejenigen Thesen rechnerisch ermittelt, die keine ausreichende Unterscheidung der Parteien und Wählervereinigungen möglich machten, und entfernt. Die Redaktion hat aus den verbleibenden eine endgültige Auswahl von 38 Thesen getroffen, die in den Wahl-O-Mat eingebunden wurden. Die Parteien und Wählervereinigungen waren an der Endauswahl der Thesen nicht beteiligt. Mehr zum Entstehungsprozess eines Wahl-O-Mat finden Sie in unserem <a tabindex="24" title="Making of (Dieser Link öffnet sich in einem neuen Fenster.)" target="_blank" class="link_normal" href="http://www.bpb.de/methodik/N7OHM4,0,0,Making_of_WahlOMat.html">"Making of"</a>.';
WOMT_aTexte['popup_faq_2_text'][1]=' ';
WOMT_aTexte['popup_faq_3_frage']=new Array();
WOMT_aTexte['popup_faq_3_frage'][0]='Wieso kommen manche wichtige Themen im Wahl-O-Mat nicht zur Sprache? ';
WOMT_aTexte['popup_faq_3_frage'][1]='&nbsp;';
WOMT_aTexte['popup_faq_3_text']=new Array();
WOMT_aTexte['popup_faq_3_text'][0]='Das ist eine schwierige Frage. Wer entscheidet, welche Themen wichtig sind und welche nicht? Die Regierung, die Parteien, die Medien und die Bürgerinnen und Bürger haben dazu sehr unterschiedliche Meinungen. Bei der Auswahl der Thesen für unseren Wahl-O-Mat bezogen wir uns vor allem auf jene Themen, zu denen die Parteien und Wählervereinigungen unterschiedliche Meinungen haben und auf jene, die besonders auch für junge Leute von Interesse sind. Leider sind während des Entstehungsprozesses auch "gute" Thesen aus dem Wahl-O-Mat gefallen. Dies kam vor, weil Thesen von einzelnen Parteien gar nicht oder nicht eindeutig mit stimme zu / stimme nicht zu / neutral beantwortet wurden oder weil die Parteipositionen in dieser These keine Unterscheidung zwischen den Parteien und Wählervereinigungen ermöglichten. Wir haben Interesse an Ihrer Meinung. Schicken Sie uns Ihre Überlegungen zu, am besten unter: <a tabindex="26" title="" class="link_normal" href="mailto:info@wahl-o-mat.de">info@wahl-o-mat.de</a>';
WOMT_aTexte['popup_faq_3_text'][1]=' ';
WOMT_aTexte['popup_faq_5_frage']=new Array();
WOMT_aTexte['popup_faq_5_frage'][0]='Was mache ich, wenn ich zu einem Thema nichts angeben möchte?';
WOMT_aTexte['popup_faq_5_frage'][1]=' ';
WOMT_aTexte['popup_faq_5_text']=new Array();
WOMT_aTexte['popup_faq_5_text'][0]='Dann enthalten Sie sich Ihrer Stimme und klicken auf "These überspringen". Diese Aussage wird dann beim Ergebnis nicht berücksichtigt. Letzteres sollten Sie aber nicht zu oft machen, denn wenn zu oft "überspringen" geklickt wird, kann auch kein zuverlässiges Ergebnis errechnet werden. Sie haben jedoch auch die Möglichkeit, jederzeit wieder zu einer These zurückzukehren, um sie doch noch zu beantworten.';
WOMT_aTexte['popup_faq_5_text'][1]=' ';
WOMT_aTexte['popup_faq_6_frage']=new Array();
WOMT_aTexte['popup_faq_6_frage'][0]='Wie ist es möglich, dass ich als Ergebnis die Partei erhalte, die ich überhaupt nicht erwartet habe?';
WOMT_aTexte['popup_faq_6_frage'][1]=' ';
WOMT_aTexte['popup_faq_6_text']=new Array();
WOMT_aTexte['popup_faq_6_text'][0]='Ja, das wissen wir natürlich auch nicht. Bitte erwarten Sie von uns kein Urteil darüber, was eine "gute" oder eine "schlechte" Partei oder Wählervereinigung ist. Es ist jedoch bekannt, dass der Wahl-O-Mat manchmal überraschende Ergebnisse aufweist. Das von Ihnen ermittelte Wahl-O-Mat Ergebnis ist eben ein Durchschnittsergebnis aus vielen Themengebieten. Es kann also sein, dass Sie bei einem Themengebiet die Meinung der Partei oder Wählervereinigung, der Sie bisher am nahesten standen, treffen, aber im Wahl-O-Mat Gesamtergebnis noch besser mit einer anderen Partei oder Wählervereinigung übereinstimmen. Berücksichtigt werden muss außerdem, dass sich das Ergebnis des Wahl-O-Mat eben nur auf die bereitgestellte Thesenauswahl bezieht. Sicher gibt es auch weitere gute Gründe, sich der einen oder anderen Partei oder Wählervereinigung nahe zu fühlen. Wir finden, dass dies eine gute Gelegenheit ist, sich mit den eigenen politischen Positionen und denen der Parteien und Wählervereinigungen auseinander zu setzen. Schauen Sie doch einfach mal auf die Webseiten der Parteien.';
WOMT_aTexte['popup_faq_6_text'][1]=' ';
WOMT_aTexte['popup_faq_7_frage']=new Array();
WOMT_aTexte['popup_faq_7_frage'][0]='Warum kann es vorkommen, dass bei mir Übereinstimmungen mit einer vom Verfassungsschutz als extremistisch eingestuften Partei angezeigt werden?';
WOMT_aTexte['popup_faq_7_frage'][1]=' ';
WOMT_aTexte['popup_faq_8_frage']=new Array();
WOMT_aTexte['popup_faq_8_frage'][0]='Ich möchte mehr erfahren als nur das Endergebnis. Wie kann ich die Einstellungen der verschiedenen Parteien zu einzelnen Thesen erfahren und vergleichen?';
WOMT_aTexte['popup_faq_8_frage'][1]=' ';
WOMT_aTexte['popup_faq_8_text']=new Array();
WOMT_aTexte['popup_faq_8_text'][0]='Auf dem Ergebnisbildschirm sehen Sie direkt, wie jede der von Ihnen ausgewählten Parteien oder Wählervereinigungen zu jeder These gestimmt hat ("stimme zu"= grünes Häkchen, "stimme nicht zu"= rotes Kreuz, "neutral"= graues Minuszeichen). Ein Klick auf das entsprechende Icon zeigt eine kurze Begründung der Partei bzw. Wählervereinigung für ihre Position an, sofern eine Begründung abgeben wurde. Wenn Sie auf dem Ergebnisbildschirm das Logo einer Partei bzw. Wählervereinigung anklicken, können Sie auf der dann folgenden Seite Ihre eigenen Stellungnahmen zu jeder These mit denen der Partei bzw. Wählervereinigung im Detail vergleichen. Auch dort finden Sie unter dem Icon "P" (= Position der Partei) kurze Begründungen der Partei bzw. Wählervereinigung für deren Positionierung.';
WOMT_aTexte['popup_faq_8_text'][1]=' ';
WOMT_aTexte['popup_faq_footer_text']=new Array();
WOMT_aTexte['popup_faq_footer_text'][0]='Wenn Sie mehr über die Entstehung des Wahl-O-Mat oder über die Möglichkeiten, ihn in pädagogischen Zusammenhängen einzusetzen, wissen möchten, finden Sie weitere Informationen auf der Startseite <a tabindex="55" title="Wahl-O-Mat Homepage (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de/unterricht" target="_blank">www.wahl-o-mat.de/unterricht</a>.';
WOMT_aTexte['popup_faq_footer_text'][1]='Wenn Sie mehr über die Entstehung des Wahl-O-Mat oder über die Möglichkeiten, ihn in pädagogischen Zusammenhängen einzusetzen, wissen möchten, finden Sie weitere Informationen auf der Startseite <a tabindex="55" title="Wahl-O-Mat Homepage (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de/unterricht" target="_blank">www.wahl-o-mat.de/unterricht</a>.';
