WOMT_aTexte['popup_impressum_text_text']=new Array();
WOMT_aTexte['popup_impressum_text_text'][0]='<h2 class="text_bold">Was ist der Wahl-O-Mat?</h2><div class="text_normal">Der Wahl-O-Mat zur Bundestagswahl 2009 ist ein Produkt der <a tabindex="2" title="Bundeszentrale für politische Bildung (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.bpb.de" target="_blank">Bundeszentrale für politische Bildung/bpb</a> mit Unterstützung des Instituut voor Publiek en Politiek (IPP) in Amsterdam. Thesen und Inhalte des Wahl-O-Mat wurden von einem Redaktionsteam aus 21 Jungwählerinnen und Jungwählern entwickelt. Beraten wurden sie von den Wissenschaftlern Prof. Stefan Marschall, Prof. Christoph Strünck, Wolf Dittmayer, Christian K. Schmidt und Tanja Binder.<br/><br/>Redaktionsschluss: 14. August 2009</div><h2 class="text_bold">Herausgeber</h2><div class="text_normal">Bundeszentrale für politische Bildung/bpb, Bonn Š 2009<br/>ViSdP: Thorsten Schilling<br/><a tabindex="10" title="" class="link_normal" href="mailto:schilling@bpb.de">schilling@bpb.de</a><br/></div><h2 class="text_bold">Redaktion/bpb</h2><div class="text_normal">Pamela Brandt (Projektleitung)<br/>Stephan Trinius (Projektleitung)<br/>Martin Hetterich</div><img class="pic1" alt="Gruppenfoto der Redaktion" title="Gruppenfoto der Redaktion" width="420" height="280" src="./pix_change/pic_impressum.jpg"/><h2 class="text_bold">Inhalt und Redaktion</h2><div class="text_normal">Tammo Behrends<br/>Viktoria Beinrott<br/>Ulrike Bergmeir<br/>Gesa van den Broek<br/>Ronja Contzen<br/>Manuel Diele<br/>Stefan Düsterhöft<br/>Mathias Großklaus<br/>Lennart Grumer<br/>Christian Hänchen<br/>Lena Hug<br/>Teresa Inclan<br/>Torsten Jensen<br/>Katharina Liebing<br/>Lisi Maier<br/>Judith Memering<br/>Anne Piezunka<br/>Regina Renner<br/>Meike Riebau<br/>Steffen Terbrüggen<br/>Felix Wendt</div><h2 class="text_bold">Inhaltliche Beratung</h2><div class="text_normal">Prof. Dr. Stefan Marschall, Universität Siegen<br/>Prof. Dr. Christoph Strünck, Universität Siegen<br/>Dipl. Soz.-Päd. Wolf Dittmayer<br/>Dipl.-Soz.-Wiss. Christian K. Schmidt<br/>Tanja Binder, M.A.<br/>Michael Bornkessel, Journalist<br/></div><h2 class="text_bold">Koordination des Redaktionsteams</h2><div class="text_normal">Dr. Christian Kemper</div><h2 class="text_bold">Gestaltungskonzept & Design</h2><div class="text_normal">Armin Berger<br/>Sonia Binder<br/><a tabindex="70" title="" class="link_normal" href="mailto:info@3-point.de">info@3-point.de</a><br/><a tabindex="71" title="3-point concepts GmbH (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.3-point.de" target="_blank">3-point concepts GmbH, Berlin</a></div><h2 class="text_bold">Programmierung</h2><div class="text_normal">Ulrich Santo<br/><a tabindex="72" title="" class="link_normal" href="mailto:santo@glamus.de">santo@glamus.de</a><br/><a tabindex="73" title="GLAMUS GmbH (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.glamus.de" target="_blank">GLAMUS GmbH, Bonn</a></div><h2 class="text_bold">Copyright</h2><div class="text_normal">Bundeszentrale für politische Bildung/bpb<br/>Adenauerallee 86<br/>53111 Bonn<br/>Tel +49 (0)228 99515-0<br/>Fax +49 (0)228 99515-498<br/><a tabindex="92" title="" class="link_normal" href="mailto:info@bpb.de">info@bpb.de</a><br/><a tabindex="93" title="Bundeszentrale für politische Bildung (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.bpb.de" target="_blank">www.bpb.de</a></div><h2 class="text_bold">Lizenz</h2><div class="text_normal"><a tabindex="94" title="Instituut voor Publiek en Politiek (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.stemwijzer.nl/" target="_blank">Instituut voor Publiek en Politiek (IPP), NL-Amsterdam</a><br/>Supervision: <a tabindex="95" title="" class="link_normal" href="mailto:j.degraaf@stemwijzer.nl">Jochum de Graaf</a></div><div class="text_normal">Die Vervielfältigung, Verbreitung und die öffentliche Wiedergabe des Wahl-O-Mat ist nicht gestattet.<br/>Der Wahl-O-Mat ist urheberrechtlich geschützt.</div>';
