WOMT_aTexte['popup_faq_7_text']=new Array();
WOMT_aTexte['popup_faq_7_text'][0]='Es werden nur die Parteien in die Berechnung des Ergebnisses aufgenommen, die Sie vorher ausgewählt haben. Übereinstimmungen hängen damit zusammen, dass die Mehrzahl der Thesen sachpolitische Themen zur Bundestagswahl anspricht. Bei diesen Thesen können extremistische Parteien Positionen vertreten, die mit denen anderer Parteien identisch sind. Bei einigen weiteren Thesen werden die Unterschiede zwischen diesen Parteien deutlich. Bitte schauen Sie sich entsprechend in der Darstellung auf der Ergebnisseite an, wie die als extremistisch eingestuften Parteien speziell bei diesen Thesen geantwortet haben. Welche Parteien als extremistisch eingestuft werden, können Sie auf den Seiten des Verfassungsschutzes nachlesen: <a class="link_normal" href="http://www.verfassungsschutz.de" tabindex="46" target="_blank" title="www.verfassungsschutz.de (Dieser Link öffnet sich in einem neuen Fenster.)">www.verfassungsschutz.de</a>. Einen informativen Überblick über alle zur Wahl zugelassenen Parteien finden Sie unter dem bpb-Angebot "Wer steht zur Wahl", <a tabindex="47" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.werstehtzurwahl.de" target="_blank">www.werstehtzurwahl.de</a>.<br/>';
