WOMT_aTexte['popup_faq_10_text']=new Array();
WOMT_aTexte['popup_faq_10_text'][0]='Bei diesen Parteien handelt es sich um diejenigen Parteien, die bei der letzten Bundestagswahl bundesweit mindestens fünf Prozent der Zweitstimmen erhalten haben und somit in Fraktionsstärke im Bundestag vertreten sind. Die CDU und die CSU bilden eine Fraktionsgemeinschaft und haben die Wahl-O-Mat-Thesen gemeinsam beantwortet. Diese sechs Parteien spielen im Wahlkampf und bei der Wahlentscheidung für viele eine besonders hervorgehobene Rolle. Sie haben in den letzten vier Jahren an der politischen Willensbildung und Entscheidungsfindung erheblich mitwirken können. Und sie haben den Wahlprognosen zufolge eine gute Chance, wieder im Deutschen Bundestag vertreten zu sein. Deswegen sind ihre Positionen zu den Themen der Bundestagswahl von besonderer Bedeutung.';
