WOMT_aTexte['popup_impressum_text_datenschutz'][0]='<h1 class="orange">Datenschutzerklärung</h1><div class="text_normal">Wir, die Bundeszentrale für politische Bildung/bpb als Lizenzgeber des Wahl-O-Mat und Inhaber der Domain www.wahl-o-mat.de, nehmen den Schutz Ihrer persönlichen Daten und Ihr Recht auf informationelle Selbstbestimmung sehr ernst und halten uns selbstverständlich an die datenschutzrechtlichen Regeln. Als öffentlich-rechtliche Stelle des Bundes unterliegen wir den Bestimmungen des Bundesdatenschutzgesetzes, dessen Zweck der Schutz vor Beeinträchtigungen des Persönlichkeitsrechts durch den Umgang mit personenbezogenen Daten ist.<br/><br/>Die Bundeszentrale für politische Bildung/bpb hat technische und organisatorische Maßnahmen getroffen, die sicherstellen, dass die Vorschriften über den Datenschutz sowohl von uns als auch von externen Dienstleistern beachtet werden.<br/><br/><b>Zugriff auf die Seiten von wahl-o-mat.de</b><br/>Jeder Zugriff auf unsere Homepage und jeder Abruf einer auf der Homepage hinterlegten Datei werden protokolliert. Die Speicherung dient internen systembezogenen und statistischen Zwecken. Protokolliert werden: Name der abgerufenen Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge, Meldung über erfolgreichen Abruf, Webbrowser und anfragende Domain. Die IP Adressen der anfragenden Rechner werden anonymisiert protokolliert, eine Rückverfolgung ist nicht möglich. Die Logfiles selbst werden maximal vier Wochen gespeichert, sie werden monatlich automatisch gelöscht.<br/><br/>Die bpb nimmt am Zählverfahren der Firma Infonline teil. Dazu sind in die einzelnen Seiten so genannte Zählpixel, kleine transparente Bilder, eingebaut, deren Abruf von der Firma Infonline gezählt wird. Dabei werden keinerlei Informationen über die Benutzer gesammelt, so werden auch keine IP-Adressen gespeichert. Die Daten werden ausschließlich in aggregierter Form auf den Seiten von Infonline gespeichert.<br/><br/><b>Personenbezogene Daten</b><br/>Personenbezogene Daten sind Informationen zu Ihrer Person, die dazu genutzt werden können, Ihre Identität zu erfahren - etwa Ihren richtigen Namen, Ihre Adresse, Postanschrift oder Telefonnummer. Informationen, die keine Rückschlüsse auf eine bestimmte oder bestimmbare Person zulassen, fallen nicht darunter.<br/><br/>Bei der Nutzung des Wahl-O-Mat werden keinerlei personenbezogene Daten erhoben. Nur, wenn Sie den Wahl-O-Mat per Mailformular weiterempfehlen möchten, werden Sie aufgefordert, eine gültige E-Mail-Adresse als Absender einzugeben. Ihr Wahl-O-Mat-Ergebnis wird dabei von uns nicht gespeichert. Mailtext und Absender-Adresse werden von uns nach erfolgreichem Versenden der Mail weder weiter verarbeitet noch gespeichert. Einzig die Mailadresse des Empfängers wird in einem Mail-Serverlog protokolliert, das nach maximal fünf Wochen gelöscht wird.<br/><br/>Die Erhebung, Verarbeitung und Nutzung dieser personenbezogenen Daten - der gültigen Mail-Adresse als Absender - auf www.wahl-o-mat.de unterliegen also Ihrer Zustimmung, und diese Daten werden nicht gespeichert. Wir erheben sie nur im technisch notwendigen Umfang, um die damit verbundene Funktion der Webseite auszuführen. In keinem Fall werden die erhobenen Daten verkauft oder aus anderen Gründen an Dritte weitergegeben. Sie werden nur zur unmittelbaren Erfüllung des Zweckes verwendet, für die wir die Daten benötigen, und sind auch nur den Personen zugänglich, die unmittelbar zur Erfüllung dieses Zweckes Zugriff auf sie haben müssen.<br/><br/>Soweit Fremdfirmen im Auftrag der Bundeszentrale für politische Bildung tätig werden - etwa, um den Server der Webseite zu pflegen -, werden diese Firmen ausdrücklich darauf verpflichtet, die Daten ausschließlich im Rahmen dieser Zweckbestimmung zu verwenden und anschließend - nach Ablauf eventuell bestehender gesetzlicher Fristen - zu löschen.<br/><br/><b>Cookies</b><br/>Der Wahl-O-Mat verwendet insgesamt zwei so genannte Cookies. Sie dienen dazu, sicherzustellen, dass ein und derselbe Nutzer nicht mehrmals in unserer Nutzungsstatistik gezählt wird. Cookies sind kleine Textdateien, die auf Ihrem Rechner abgelegt werden und die Ihr Browser speichert. Cookies richten auf Ihrem Rechner keinen Schaden an und enthalten keine Viren. Der Wahl-O-Mat funktioniert auch ohne Cookies.<br/><br/><b>Umfrage</b><br/>Am Ende des Wahl-O-Mat wird einer zufälligen Auswahl von Nutzerinnen und Nutzern die Möglichkeit angeboten, an einer wissenschaftlichen Evaluation des Wahl-O-Mat teilzunehmen. Die Teilnahme ist freiwillig, die Umfrage ist anonym, d.h. bei ihr werden ebenfalls keine personenbezogenen Daten erfasst. Um Ihr Wahl-O-Mat Ergebnis mit Ihren Antworten im Fragebogen zu korrelieren, wird die Webadresse ihres Wahl-O-Mat-Ergebnisses (Query Session-ID) mit den Antworten im Fragebogen verknüpft. Ihre IP-Adresse wird hierbei jedoch nicht gespeichert. Auf der Seite <a tabindex="100" title="Universität Siegen (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.uni-siegen.de/wahlomat" target="_blank">http://www.uni-siegen.de/wahlomat</a> können Sie die Ergebnisse der Evaluationen einsehen.<br/><br/><b>Kooperationspartner</b><br/>Diese Datenschutzerklärung gilt nur für den Server von www.wahl-o-mat.de. Der Wahl-O-Mat wird jedoch auch von Kooperations- und Medienpartnern der bpb auf deren eigenen Servern betrieben. Auf diesen kann es andere Datenschutzrichtlinien geben. Die bpb übernimmt keine Verantwortung für die Datenschutzrichtlinien dieser externen Webseiten.<br/><br/>Kooperations-/Medienpartner der bpb stellen der bpb lediglich täglich die Zahl der insgesamt erfolgten Nutzungen des Wahl-O-Mat auf deren Servern zu, die in die Nutzungsstatistik auf www.wahl-o-mat.de eingehen.<br/><br/><b>Auskunftsrecht</b><br/>Sie haben jederzeit das Recht auf Auskunft über die bezüglich Ihrer Person gespeicherten Daten, deren Herkunft und Empfänger sowie den Zweck der Speicherung. Auskunft über die gespeicherten Daten gibt die Datenschutzbeauftragte der Bundeszentrale für politische Bildung: <a title="" class="link_normal" href="mailto:diehl@bpb.de" tabindex="101">diehl@bpb.de</a>.<br/><br/><b>Fragen und Kommentare</b><br/>Wenn Sie Fragen haben, die diese Datenschutzerklärung nicht beantworten konnte, wenn Sie zu einem Punkt weitere Informationen haben möchten oder Anregungen oder Kommentare haben, können Sie sich gern direkt per E-Mail an die Datenschutzbeauftragte der Bundeszentrale für politische Bildung wenden: <a tabindex="102" title="" class="link_normal" href="mailto:diehl@bpb.de">diehl@bpb.de</a>.</div>';
