WOMT_aTexte['4_erg_text_1'][0]='Hinweis: Eine ähnlich hohe Übereinstimmung zwischen Ihren Antworten und den Antworten mehrerer Parteien bedeutet nicht zwangsläufig eine inhaltliche Nähe der Parteien zueinander.<br/><br/>Die meisten der 38 Wahl-O-Mat-Thesen decken wichtige sachpolitische Themen zur Bundestagswahl ab. Auf diese haben auch Parteien geantwortet, die vom Verfassungsschutz als extremistisch eingestuft werden (<a class="pfeil_fett" href="http://www.verfassungsschutz.de" tabindex="39" title="www.verfassungsschutz.de (Dieser Link öffnet sich in einem neuen Fenster.)" target="_blank" style="padding-left:0px;background-image: none !important;">www.verfassungsschutz.de</a>). Extremistische Einstellungen einzelner Parteien werden nur in wenigen Thesen erfasst. Vergleichen Sie daher unten die Antworten der Parteien auf alle Thesen. Bitte schauen Sie zur Einordnung der einzelnen Parteien auch unter <a tabindex="39" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="pfeil_fett" href="http://www.wahl-o-mat.de/bundestagswahl2009/wszw.php" target="_blank">www.werstehtzurwahl.de</a>.';
WOMT_aTexte['4_erg_text_1'][1]='Notice: A similarly high correspondence between your answers and those of several parties does not necessarily mean those parties are ideologically close.<br/><br/>Most of the Wahl-O-Mat#s questions cover important political issues for the 2009 Bundestag election. They include answers from parties considered extremist by Germany#s domestic intelligence service the Verfassungsschutz (<a class="pfeil_fett" href="http://www.verfassungsschutz.de" tabindex="39" title="www.verfassungsschutz.de (This link will open in a new window.)" target="_blank" style="padding-left:0px;background-image: none !important;">www.verfassungsschutz.de</a>).  The extremist positions of these parties are covered only in a few questions. You should therefore examine the answers of the parties on all the issues. You can find out more about a specific party at: <a tabindex="39" title="Wer steht zur Wahl? (This link will open in a new window.)" class="pfeil_fett"  href="http://www.wahl-o-mat.de/bundestagswahl2009/wszw.php" target="_blank">www.werstehtzurwahl.de</a>';
